request.description:
This endpoint makes an HTTP GET request to the specified URL to convert a three-word address (what3words) to coordinates. It requires the API key and the three-word address as query parameters.

The response to the request will have a status code of 200, and it will include the coordinates corresponding to the provided three-word address, along with additional information such as the country, nearest place, language, and map details.

Example:
```plaintext
GET https://api.what3words.com/v3/convert-to-coordinates?key=YOUR-API-KEY&words=filled.count.soap
```

Response:
```json
{
    "country": "",
    "square": {
        "southwest": {
            "lng": 0,
            "lat": 0
        },
        "northeast": {
            "lng": 0,
            "lat": 0
        }
    },
    "nearestPlace": "",
    "coordinates": {
        "lng": 0,
        "lat": 0
    },
    "words": "",
    "language": "",
    "map": ""
}
```

